                            </div>
                        </div>
                    </div>
                </div>
            </div>
            {/* <ModalVideo 
                style={ modalStyles }
                channel='youtube' 
                isOpen={this.state.isOpen} 
                videoId='bk7McNUjWgw' 
                onClose={() => this.setState({isOpen: false})} 
            /> */}
            </div>
        );
    }
}
 
export default Banner;
